// Function controls defeat song
// Input: pt is a pointer to an array of DAC outputs
// count is the length of the array
// Output: none
// special cases: as you wish to implement
void Music_Start_Defeat(void){
	// Reminder to set count in main to 0 before using, otherwise func will not work correctly
	if(count<SorrowEnd){
	ArrayPointer = &NoHope[count];
	}
	else{
	void (*MusicPointer)(void);
	MusicPointer = &Music_Stop;
	Timer0_Init(MusicPointer,7272);
	}
	if(soundFlag == 1 && halfcounter == 1){
		DAC_Out((*ArrayPointer+((*TrackPointer-127)/4+127))/2);
		TrackPointer++;
		startFlag++;
		count++;
		if(startFlag >= EffectCount){
			soundFlag = 0;
		}
	}
	else if(soundFlag == 1 && halfcounter == 0){
		DAC_Out(((*TrackPointer-127)/4+127));
		TrackPointer++;
		startFlag++;
		if(startFlag >= EffectCount){
			soundFlag = 0;
		}
	}
	else if(halfcounter == 1){
		DAC_Out(*ArrayPointer);
		count++;
	}
	halfcounter ^= 0x01;
}


