//******* Music Stop************
// Function controls the Music on the main play screen, using systick
// Input: pt is a pointer to an array of DAC outputs
// count is the length of the array
// Output: none
// special cases: as you wish to implement
void Music_Stop(void){
ArrayPointer = 0;
count = 0;
halfcounter = 1;
	if(soundFlag == 1){
		DAC_Out(((*TrackPointer-127)/4+127));
		TrackPointer++;
		startFlag++;
		if(startFlag >= EffectCount){
			soundFlag = 0;
		}
	}
}

//******* Music Start Background Main ************
// Function controls the Music on the main play screen, using systick
// Input: pt is a pointer to an array of DAC outputs
// count is the length of the array
// Output: none
// special cases: as you wish to implement

void Music_Start_Background_Main(void){
	ArrayPointer = &ChiptuneLooped[count%124459];
	if(soundFlag == 1 && halfcounter == 1){
		DAC_Out((*ArrayPointer+((*TrackPointer-127)/4+127))/2);
		TrackPointer++;
		startFlag++;
		count++;
		if(startFlag >= EffectCount){
			soundFlag = 0;
		}
	}
	else if(soundFlag == 1 && halfcounter == 0){
		DAC_Out(((*TrackPointer-127)/4+127));
		TrackPointer++;
		startFlag++;
		if(startFlag >= EffectCount){
			soundFlag = 0;
		}
	}
	else if(halfcounter == 1){
		DAC_Out(*ArrayPointer);
		count++;
	}
	halfcounter ^= 0x01;
}
